import React, { FC } from "react";
import { Row, Col } from "antd";
import LeftSide from "./components/LeftSide";
import SignUp from "./components/SignUp";
import SignIn from "./components/SignIn";
import "./App.less";

const App: FC = () => {
  return (
    <>
      <Row>
        <Col span={6}>
          <LeftSide />
        </Col>
        <Col span={18}>
          <SignUp />
          {/* <SignIn /> */}
        </Col>
      </Row>
    </>
  );
};

export default App;
